My "trip in hell" doesn't stop here. Those pictures are signs that I am capable enough of conquering such hell for 12 years, and I supposed for another many more years to come. I'm done with my 1st stage of life, and soon it comes the 2nd stage. Let this picture be a motivation to add some more photos for which I can be proud of myself in the collection üí™üèÖüèÜ

